import React from 'react'
import styled from 'styled-components'
import PinterestIcon from '@mui/icons-material/Pinterest';
import { IconButton } from '@mui/material';

function Header() {
    return (
        <div>
            <Wrapper>
                <LogoWrapper>
                    <IconButton>
                        <PinterestIcon />
                    </IconButton>
                </LogoWrapper>
                <HomePageButton>
                    <a href="/">Homepage</a>
                </HomePageButton>
                <FollowingButton>
                    <a href="/">Following</a>
                </FollowingButton>
                <SearchWrapper>
                    <SearchBarWrapper>
                        <IconButton>
                            <SearchIcon />
                        </IconButton>
                        <form>
                            <input type="text" onChange={(e) => setInput(e.target.value)} />
                            <button type="submit" onClick={onSearchSubmit}>

                            </button>
                        </form>
                    </SearchBarWrapper>
                </SearchWrapper>
            </Wrapper>
            <h1>Header</h1>
        </div>
    )
}

export default Header

const HomeButton = styled.div`
display: flex;
height: 48px;
min-width: 123px;
align-items: center;
justify-content: center;
border-radius: 24px;
cursor: pointer;
`

const Wrapper = styled.div`
  display: flex;
  align-items: center;
  height: 56px;
  padding: 12px 4px 4px 16px;
  background-color: white;
  color: black;
`;
const LogoWrapper = styled.div`
  .MuiSvgIcon-root {
    color: #e60023;
    font-size: 32px;
    cursor: pointer;
  }
  :hover {
    background-color: #e2e1e2;
    border-radius: 20px;
  }
`;
const HomePageButton = styled(HomeButton)`
    background-color: rgb(17, 17, 17);

    a {
        text-decoration: none;
        color: white;
        font-weight: 700;
    }
`;
const FollowingButton = styled(HomeButton)`
   background-color: white;

  a {
    text-decoration: none;
    color: black;
    font-weight: 700;
  }

  :hover {
    background-color: #e2e1e2;
  }
`;
